We Can Rock&amp;#039;s debut release! Comprising of songs made over the Summer of 2007, Uil&amp;#039;s second EP shows one of his older sides, but it still holds strong today.

He&amp;#039;s also still terrible at describing his music. The only way to really understand is to give it a listen.

